import "./App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Navbar from "./components/layout/Navbar";

function App() {
  return (
    <Router>
      <>
        <Navbar title="Contact Diary" />
        <Switch>
          <Route exact to="/" component={Home} />
        </Switch>
      </>
    </Router>
  );
}

export default App;
